const theme = {
  global: {
    colors: {
      brand: '#2ff22e',
    },
    font: {
      family: 'Roboto',
      size: '20px',
      height: '20px',
      weight: 'bold',

    },
  },
};

const AppBarPre = (props: JSX.IntrinsicAttributes & BoxExtendedProps) => (
  <Box
    tag='header'
    direction='row'
    align='center'
    justify='between'
    background='#40C040'
    pad={{ left: 'medium', right: 'small', vertical: 'small' }}
    elevation='medium'
    style={{ zIndex: '1' }}
    // color='#FFFFFF'
    {...props}
  />
);

const AppBar = (props: JSX.IntrinsicAttributes & BoxExtendedProps) => (
  <Box
    tag='header'
    direction='row'
    align='center'
    justify='between'
    background='white'
    pad={{ left: 'medium', right: 'small', vertical: 'small' }}
    elevation='medium'
    style={{ zIndex: '1' }}
    {...props}
  />
);

function App() {
  return (
