      <AppBar> <div><img src={logo} alt="logo" width="30px"/> <b className="p4">POWERED BY ALINA</b> </div> <Button primary={false} title="В этой кнопке заключён главный принцип экзистенциализма Альбера Камю по версии Алины" label='tap' /></AppBar>
    </Grommet>
  );
}

export default App;
